import{_ as e,c as t,o as a,d as r}from"./app.e0e4ea3a.js";const g=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[{"level":2,"title":"title: \u6D82\u4F1F\u5FE0-\u6B63\u5219\u8868\u8FBE\u5F0F\u5165\u95E8\u8BFE","slug":"title-\u6D82\u4F1F\u5FE0-\u6B63\u5219\u8868\u8FBE\u5F0F\u5165\u95E8\u8BFE","link":"#title-\u6D82\u4F1F\u5FE0-\u6B63\u5219\u8868\u8FBE\u5F0F\u5165\u95E8\u8BFE","children":[]},{"level":2,"title":"\u719F\u7EC3\u8FD0\u7528\uFF0C\u800C\u4E0D\u6EE5\u7528","slug":"\u719F\u7EC3\u8FD0\u7528\uFF0C\u800C\u4E0D\u6EE5\u7528","link":"#\u719F\u7EC3\u8FD0\u7528\uFF0C\u800C\u4E0D\u6EE5\u7528","children":[]},{"level":2,"title":"\u5982\u4F55\u8FDB\u4E00\u6B65\u6210\u957F\uFF1F","slug":"\u5982\u4F55\u8FDB\u4E00\u6B65\u6210\u957F\uFF1F","link":"#\u5982\u4F55\u8FDB\u4E00\u6B65\u6210\u957F\uFF1F","children":[]}],"relativePath":"\u5176\u4ED6/\u6D82\u4F1F\u5FE0-\u6B63\u5219\u8868\u8FBE\u5F0F\u5165\u95E8\u8BFE/\u7ED3\u675F\u8BED-\u4F7F\u7528\u6B63\u5219\u63D0\u9AD8\u4F60\u7684\u4EBA\u751F\u6548\u7387.md"}'),p={name:"\u5176\u4ED6/\u6D82\u4F1F\u5FE0-\u6B63\u5219\u8868\u8FBE\u5F0F\u5165\u95E8\u8BFE/\u7ED3\u675F\u8BED-\u4F7F\u7528\u6B63\u5219\u63D0\u9AD8\u4F60\u7684\u4EBA\u751F\u6548\u7387.md"},i=r('<hr><h2 id="title-\u6D82\u4F1F\u5FE0-\u6B63\u5219\u8868\u8FBE\u5F0F\u5165\u95E8\u8BFE" tabindex="-1">title: \u6D82\u4F1F\u5FE0-\u6B63\u5219\u8868\u8FBE\u5F0F\u5165\u95E8\u8BFE <a class="header-anchor" href="#title-\u6D82\u4F1F\u5FE0-\u6B63\u5219\u8868\u8FBE\u5F0F\u5165\u95E8\u8BFE" aria-hidden="true">#</a></h2><p>\u7ED3\u675F\u8BED | \u4F7F\u7528\u6B63\u5219\u63D0\u9AD8\u4F60\u7684\u4EBA\u751F\u6548\u7387</p><p>\u4F60\u597D\uFF0C\u6211\u662F\u4F1F\u5FE0\u3002</p><p>\u65F6\u95F4\u8FC7\u5F97\u771F\u5FEB\uFF0C\u6211\u4EEC\u8FD9\u95E8\u300A\u6B63\u5219\u8868\u8FBE\u5F0F\u5165\u95E8\u8BFE\u300B\u5230\u8FD9\u91CC\u4E5F\u5C31\u544A\u4E00\u6BB5\u843D\u4E86\u3002</p><p>\u867D\u7136\u6211\u4E4B\u524D\u505A\u8FC7\u6BCF\u65E5\u4E00\u8BFE\u7684\u8BFE\u7A0B\uFF0C\u4E5F\u7ECF\u5E38\u7ED9\u670B\u53CB\u50CF\u8BB2\u8BFE\u4E00\u6837\u8BB2\u6B63\u5219\u3002\u4F46\u5B9E\u9645\u4E0A\uFF0C\u60F3\u8981\u771F\u6B63\u628A\u6B63\u5219\u7528\u4E00\u95E8\u8BFE\u7684\u5F62\u5F0F\u6765\u5448\u73B0\u51FA\u6765\uFF0C\u8FD8\u662F\u4E0D\u7B80\u5355\u7684\u3002\u6211\u6BCF\u7BC7\u6587\u7AE0\u7684\u5199\u7A3F\u65F6\u95F4\u57FA\u672C\u90FD\u5728\u5341\u4E2A\u5C0F\u65F6\u4EE5\u4E0A\uFF0C\u53EF\u4EE5\u8BF4\uFF0C\u6B63\u5219\u8FD9\u4E2A\u4E13\u680F\u503E\u6CE8\u4E86\u6211\u5F88\u591A\u7684\u5FC3\u601D\u3002\u6BCF\u6B21\u6DF1\u591C\u7EDE\u5C3D\u8111\u6C41\u5199\u7A3F\u7565\u611F\u75B2\u60EB\u7684\u65F6\u5019\uFF0C\u770B\u770B\u5927\u5BB6\u5145\u6EE1\u70ED\u60C5\u7684\u7559\u8A00\uFF0C\u771F\u662F\u7ED9\u4E86\u6211\u5F88\u591A\u7684\u529B\u91CF\u3002</p><p>\u6240\u4EE5\u501F\u7740\u8FD9\u4E2A\u5B9D\u8D35\u7684\u673A\u4F1A\uFF0C\u6211\u60F3\u7279\u522B\u611F\u8C22\u6240\u6709\u53C2\u4E0E\u8FD9\u4E2A\u4E13\u680F\u7684\u540C\u5B66\uFF0C\u611F\u8C22\u4F60\u4EEC\u4E00\u8DEF\u7684\u966A\u4F34\u548C\u575A\u6301\uFF0C\u501F\u7740\u8FD9\u4E2A\u673A\u4F1A\uFF0C\u6211\u4E5F\u518D\u548C\u4F60\u5520\u53E8\u5520\u53E8\uFF0C\u5982\u4F55\u8FD0\u7528\u6B63\u5219\u4EE5\u53CA\u5982\u4F55\u8FDB\u4E00\u6B65\u6210\u957F\u3002</p><p>\u6B63\u5219\u6D89\u53CA\u7684\u7F16\u7A0B\u8BED\u8A00\u548C\u5DE5\u5177\u975E\u5E38\u591A\uFF0C\u6211\u6CA1\u6709\u529E\u6CD5\u53BB\u5B8C\u5168\u8BB2\u5B8C\uFF0C\u56E0\u4E3A\u90A3\u6837\u4E13\u680F\u4F1A\u53D8\u5F97\u6BD4\u8F83\u7410\u788E\u3002\u5728\u6211\u770B\u6765\uFF0C\u54B1\u4EEC\u5B66\u4E60\u4EFB\u4F55\u5185\u5BB9\uFF0C\u5728\u4E00\u5F00\u59CB\u65F6\uFF0C\u90FD\u4E0D\u8981\u8FC7\u5206\u53BB\u6CE8\u91CD\u7EC6\u8282\uFF0C\u91CD\u8981\u7684\u662F\u638C\u63E1\u6B63\u786E\u7684\u65B9\u6CD5\uFF0C\u5148\u4ECE\u6574\u4F53\u4E0A\u5165\u624B\uFF0C\u638C\u63E1\u6838\u5FC3\u7684\u6982\u5FF5\u3002\u6BD4\u5982\u5F53\u4F60\u5B66\u4E60\u4E86\u5B57\u7B26\u7EC4\u3001\u591A\u9009\u7ED3\u6784\u3001\u91CF\u8BCD\u3001\u951A\u70B9\u3001\u8D2A\u5A6A&amp;\u975E\u8D2A\u5A6A\u3001\u6D41\u6D3E\u3001\u5339\u914D\u539F\u7406\u8FD9\u4E9B\u6838\u5FC3\u77E5\u8BC6\u4E4B\u540E\uFF0C\u4F60\u8981\u5728\u540E\u7EED\u9047\u5230\u95EE\u9898\u65F6\uFF0C\u67E5\u9605\u4E00\u4E0B\u76F8\u5173\u6587\u6863\uFF0C\u5F88\u5FEB\u5C31\u53EF\u4EE5\u89E3\u51B3\u6389\u4E86\u3002</p><h2 id="\u719F\u7EC3\u8FD0\u7528\uFF0C\u800C\u4E0D\u6EE5\u7528" tabindex="-1">\u719F\u7EC3\u8FD0\u7528\uFF0C\u800C\u4E0D\u6EE5\u7528 <a class="header-anchor" href="#\u719F\u7EC3\u8FD0\u7528\uFF0C\u800C\u4E0D\u6EE5\u7528" aria-hidden="true">#</a></h2><p>\u6709\u4E9B\u540C\u5B66\u5728\u5B66\u4E60\u6B63\u5219\u4E4B\u540E\uFF0C\u9047\u5230\u95EE\u9898\u603B\u662F\u60F3\u201C\u5C55\u793A\u4E00\u4E0B\u8EAB\u624B\u201D\uFF0C\u8FD9\u79CD\u5FC3\u7406\u65E0\u53EF\u539A\u975E\uFF0C\u4F46\u4E00\u5B9A\u8981\u8BB0\u4F4F\u5728\u4F7F\u7528\u6B63\u5219\u7684\u8FC7\u7A0B\u4E2D\uFF0C\u4E00\u5B9A\u8981\u514B\u5236\u3002</p><p>\u6211\u4E4B\u524D\u5728\u8BFE\u7A0B\u91CC\u9762\u63D0\u5230\u7684\uFF0C\u201C<a href="https://time.geekbang.org/column/article/259437" target="_blank" rel="noreferrer">\u5BC6\u7801\u662F6\u4F4D\uFF0C\u4E14\u4E0D\u80FD\u6709\u8FDE\u7EED\u4E24\u4E2A\u6570\u5B57\u51FA\u73B0</a>\u201D\u8FD9\u4E2A\u4F8B\u5B50\uFF0C\u5982\u679C\u4F60\u8981\u9AD8\u6548\u89E3\u51B3\u8FD9\u4E2A\u95EE\u9898\uFF0C\u6CA1\u5FC5\u8981\u975E\u5F97\u7528\u6B63\u5219\uFF0C\u5B8C\u5168\u53EF\u4EE5\u904D\u5386\u4E00\u4E0B\u5B57\u7B26\u4E32\uFF0C\u770B\u4E0B\u6709\u6CA1\u6709\u4E24\u4E2A\u8FDE\u7EED\u7684\u6570\u5B57\uFF0C\u8FD9\u6837\u89E3\u51B3\u8D77\u6765\u5BB9\u6613\u3002</p><p>\u6240\u4EE5\u554A\uFF0C\u4E0D\u8981\u603B\u60F3\u7740\u975E\u5F97\u7528\u6B63\u5219\u6765\u5B8C\u6210\u4E8B\u60C5\uFF0C\u4E5F\u4E0D\u8981\u603B\u662F\u60F3\u4F7F\u7528\u4E00\u4E2A\u6B63\u5219\u6765\u5B8C\u6210\u6574\u4EF6\u4E8B\u60C5\uFF0C\u5982\u679C\u4F60\u628A\u4E00\u4E2A\u6B63\u5219\u62C6\u5206\u6210\u591A\u4E2A\u6B63\u5219\u66F4\u65B9\u4FBF\u3001\u66F4\u6613\u4E8E\u7406\u89E3\u548C\u7EF4\u62A4\uFF0C\u6211\u4EEC\u5C31\u62C6\u6210\u4F7F\u7528\u591A\u4E2A\u6B63\u5219\u6765\u5B8C\u6210\u3002\u6BD4\u5982\u521A\u521A\u8BF4\u7684\u4F8B\u5B50\uFF0C\u6211\u4EEC\u53EF\u4EE5\u5148\u5224\u65AD\u8F93\u5165\u7684\u5185\u5BB9\u662F\u4E0D\u662F\u7B26\u5408 \\w{6}\uFF0C \u518D\u5224\u65AD\u91CC\u9762\u662F\u4E0D\u662F\u6709\u8FDE\u7EED\u7684\u4E24\u4F4D\u6570\u5B57\uFF0C\u8FD9\u6837\u901A\u8FC7\u5206\u6B65\u89E3\u51B3\u4F1A\u7B80\u5355\u5F88\u591A\u3002</p><p>\u6211\u4EEC\u8981\u719F\u7EC3\u8FD0\u7528\u6B63\u5219\uFF0C\u4F46\u4E0D\u80FD\u6EE5\u7528\u6B63\u5219\uFF0C\u4E0D\u8981\u624B\u91CC\u62FF\u7740\u9524\u5B50\uFF0C\u770B\u5565\u90FD\u662F\u9489\u5B50\u3002\u7528\u666E\u901A\u5B57\u7B26\u4E32\u5C31\u80FD\u5F88\u597D\u89E3\u51B3\u7684\u95EE\u9898\uFF0C\u5C31\u4E0D\u8981\u4F7F\u7528\u6B63\u5219\u3002\u7528\u591A\u4E2A\u6B63\u5219\u66F4\u6E05\u6670\uFF0C\u66F4\u4E0D\u5BB9\u6613\u51FA\u9519\uFF0C\u5C31\u4E0D\u8981\u6709\u201C\u975E\u5F97\u8981\u7528\u4E00\u4E2A\u6B63\u5219\u89E3\u51B3\u6240\u6709\u95EE\u9898\u201D\u7684\u6267\u5FF5\u3002\u6BD5\u7ADF\u6211\u4EEC\u5B66\u4E60\u6B63\u5219\u7684\u76EE\u7684\uFF0C\u5C31\u662F\u60F3\u9AD8\u6548\u5730\u5B8C\u6210\u6587\u672C\u5904\u7406\u5DE5\u4F5C\uFF0C\u4F46\u5B8C\u6210\u8FD9\u4E2A\u76EE\u6807\u6709\u5F88\u591A\u65B9\u5F0F\uFF0C\u6B63\u5219\u53EA\u662F\u5176\u4E2D\u4E00\u79CD\u3002</p><h2 id="\u5982\u4F55\u8FDB\u4E00\u6B65\u6210\u957F\uFF1F" tabindex="-1">\u5982\u4F55\u8FDB\u4E00\u6B65\u6210\u957F\uFF1F <a class="header-anchor" href="#\u5982\u4F55\u8FDB\u4E00\u6B65\u6210\u957F\uFF1F" aria-hidden="true">#</a></h2><p>\u5728\u8FD9\u4E2A\u6280\u672F\u592A\u591A\uFF0C\u53D8\u5316\u592A\u5FEB\u7684\u65F6\u4EE3\uFF0C\u6211\u4EEC\u9700\u8981\u4E0D\u65AD\u5730\u5B66\u4E60\u3002\u540C\u6837\uFF0C\u6211\u4E5F\u5F88\u5E86\u5E78\u6B63\u662F\u5728\u8FD9\u4E2A\u65F6\u4EE3\uFF0C\u6709\u4E86\u50CF\u6781\u5BA2\u65F6\u95F4\u8FD9\u6837\u7684\u5E73\u53F0\uFF0C\u6211\u4EEC\u80FD\u591F\u4EE5\u4E13\u680F\u8FD9\u79CD\u5168\u65B0\u7684\u65B9\u5F0F\u6765\u8FDB\u884C\u5B66\u4E60\u3002\u53EF\u80FD\u4F60\u4F1A\u89C9\u5F97\u6280\u672F\u592A\u591A\uFF0C\u538B\u6839\u5B66\u4E0D\u5B8C\uFF0C\u4F46\u4E0D\u8981\u62C5\u5FC3\uFF0C\u57FA\u7840\u539F\u7406\u6027\u7684\u4E1C\u897F\u7EDD\u5BF9\u53EF\u63A7\u3002\u6211\u4EEC\u9700\u8981\u505A\u7684\u5C31\u662F\u6C89\u4E0B\u5FC3\u6765\uFF0C\u4E0D\u8981\u6D45\u5C1D\u8F84\u6B62\uFF0C\u8D8A\u662F\u57FA\u7840\u7684\u5185\u5BB9\u8D8A\u91CD\u8981\uFF0C\u4E00\u6B21\u6027\u591A\u6295\u5165\u4E9B\u65F6\u95F4\uFF0C\u5F04\u6E05\u695A\uFF0C\u641E\u660E\u767D\u3002\u591A\u52A8\u624B\u7EC3\u4E60\uFF0C\u5B9E\u8DF5\u51FA\u771F\u77E5\u3002</p><p>**\u5F53\u4F60\u89C9\u5F97\u4F60\u638C\u63E1\u4E86\u6B63\u5219\u4E4B\u540E\uFF0C\u4F60\u53EF\u4EE5\u5C1D\u8BD5\u628A\u5B83\u6559\u7ED9\u522B\u4EBA\uFF0C\u6216\u8005\u4F60\u53EF\u4EE5\u60F3\u4E00\u4E0B\uFF0C\u5982\u679C\u8BA9\u4F60\u6765\u8BB2\u6B63\u5219\uFF0C\u4F60\u4F1A\u600E\u4E48\u8BB2\uFF1F**\u8FD9\u6837\u80FD\u591F\u8BA9\u4F60\u6709\u66F4\u6DF1\u523B\u7684\u7406\u89E3\uFF0C\u7528\u8FD9\u4E2A\u65B9\u6CD5\uFF0C\u4F60\u5C31\u80FD\u77E5\u9053\uFF0C\u81EA\u5DF1\u5230\u5E95\u662F\u4E0D\u662F\u771F\u7684\u641E\u61C2\u6B63\u5219\u4E86\u3002</p><p>\u5982\u679C\u4F60\u575A\u6301\u5B66\u5B8C\u4E86\u8FD9\u4E2A\u4E13\u680F\uFF0C\u90A3\u4E48\u4F60\u5BF9\u6B63\u5219\u7684\u638C\u63E1\u5DF2\u7ECF\u8D85\u8FC7\u4E86\u7EDD\u5927\u591A\u6570\u4EBA\uFF0C\u5728\u65E5\u5E38\u5DE5\u4F5C\u4E2D\u4F7F\u7528\u5E94\u8BE5\u6CA1\u4EC0\u4E48\u95EE\u9898\u4E86\u3002\u53E6\u5916\uFF0C\u5982\u679C\u4F60\u89C9\u5F97\u8FD8\u6CA1\u6709\u5B66\u8FC7\u763E\uFF0C\u53EF\u4EE5\u518D\u53BB\u770B\u4E00\u4E0B\u300A\u7CBE\u901A\u6B63\u5219\u8868\u8FBE\u5F0F\u300B\uFF08\u7B2C3\u7248\uFF09\u548C \u300A\u6B63\u5219\u6307\u5F15\u300B\uFF08\u7B2C2\u7248\uFF09\u8FD9\u4E24\u672C\u4E66\u3002\u7B2C\u4E00\u672C\u4E66\u4E0D\u7528\u591A\u8BF4\uFF0C\u8FD9\u5E94\u8BE5\u662F\u6B63\u5219\u65B9\u9762\u6700\u4E3A\u6743\u5A01\u7684\u4E00\u672C\u4E66\u4E86\uFF0C\u5BF9\u6B63\u5219\u7684\u539F\u7406\u7B49\u90FD\u6709\u6BD4\u8F83\u6DF1\u5165\u7684\u8BB2\u8FF0\u3002\u7B2C\u4E8C\u672C\u662F\u4F59\u665F\u5199\u7684\uFF0C\u6709\u5927\u91CF\u7684\u7F16\u7A0B\u8BED\u8A00\u793A\u4F8B\uFF0C\u6BD4\u8F83\u63A5\u5730\u6C14\uFF0C\u5BF9\u6B63\u5219\u8868\u8FBE\u5F0F\u5982\u4F55\u5904\u7406\u4E2D\u6587\u6709\u6BD4\u8F83\u8BE6\u7EC6\u7684\u8BB2\u89E3\u3002</p><p>\u5230\u6B64\uFF0C\u6211\u7684\u300A\u6B63\u5219\u8868\u8FBE\u5F0F\u5165\u95E8\u8BFE\u300B\u4E5F\u5C31\u544A\u4E00\u6BB5\u843D\u4E86\u3002\u4E0D\u8FC7\u8BFE\u7A0B\u7ED3\u675F\u5E76\u4E0D\u662F\u7EC8\u70B9\uFF0C\u6211\u4EEC\u8FD8\u53EF\u4EE5\u5728\u7559\u8A00\u533A\u4E92\u52A8\u4EA4\u6D41\u3002\u6211\u4E5F\u4F1A\u4E0D\u5B9A\u671F\u66F4\u65B0\u4E13\u680F\uFF0C\u4EE5\u52A0\u9910\u7B49\u65B9\u5F0F\u6765\u7EE7\u7EED\u5B8C\u5584\u8FD9\u7BC7\u4E13\u680F\uFF0C\u548C\u4F60\u4E00\u8D77\u7EE7\u7EED\u7CBE\u8FDB\u3002\u6211\u575A\u4FE1\u6B63\u5219\u8868\u8FBE\u5F0F\u8FD9\u4E2A\u5DE5\u5177\uFF0C\u638C\u63E1\u4E4B\u540E\u4E00\u5B9A\u4F1A\u8BA9\u4F60\u53D7\u76CA\u7EC8\u751F\uFF0C\u613F\u6B63\u5219\u80FD\u63D0\u9AD8\u4F60\u7684\u4EBA\u751F\u6548\u7387\u3002</p><p>\u5F53\u7136\uFF0C\u6211\u77E5\u9053\u5F88\u591A\u540C\u5B66\u90FD\u559C\u6B22\u201C\u6F5C\u6C34\u201D\uFF0C\u4F46\u662F\u5728\u672C\u7BC7\u4E13\u680F\u7684\u6700\u540E\uFF0C\u6211\u5E0C\u671B\u4F60\u80FD<strong>\u5206\u4EAB\u4E00\u4E0B\u4F60\u7684\u5B66\u4E60\u65B9\u6CD5</strong>\u3002\u6B64\u5916\uFF0C\u6211\u7ED9\u4F60\u51C6\u5907\u4E86\u4E00\u4EFD\u6BD5\u4E1A\u8C03\u67E5\u95EE\u5377\uFF0C\u9898\u76EE\u4E0D\u591A\uFF0C\u5E0C\u671B\u4F60\u82B1\u4E24\u5206\u949F\u586B\u5199\u4E00\u4E0B\uFF0C\u6211\u975E\u5E38\u60F3\u542C\u542C\u4F60\u5BF9\u8FD9\u4E2A\u8BFE\u7A0B\u7684\u6536\u83B7\u548C\u5EFA\u8BAE\u3002\u6700\u540E\uFF0C\u518D\u6B21\u611F\u8C22\uFF01\u6211\u4EEC\u7559\u8A00\u533A\u89C1\u3002</p><p><a href="https://jinshuju.net/f/vGf4Hm" target="_blank" rel="noreferrer"><img src="https://static001.geekbang.org/resource/image/3e/d8/3eb244c9889053bd653768bbef90b3d8.jpg" alt=""></a></p>',20),_=[i];function n(l,s,c,d,h,o){return a(),t("div",null,_)}